import React ,{useState}from "react";
import Swal from 's';



function Popupp(){
  
    return(
            <div>
              {
                Swal.fire({
                  title: 'Error!',
                  text: 'Do you want to continue',
                  type: 'error',
                  confirmButtonText: 'Cool'
                })
              }
                <h1></h1>
            </div>
    )
}

export default Popupp;
